    Summary Page now correctly reflects the correct Column B totals.  2.\tThe H2 ratio
    has been included in this amended report.  3.\tThe contribution refund previously
    reported on Schedule H4 has been relocated to correctly report on Line 28a  4.\tThe
    itemization for the payments made to Scott Arceneaux have been included in this
    amended report.  5.\tThe payments to Michael Maurino were not for fundraising
    events but rather Committee meetings and seminars, which are administrative expenses.
    \ The purpose code has been changed to reflect this.  The payments made to Fantasy
    of Flight, Big Game Liquors, and ABC Liquors were catering costs for meeting expenses.
    \ The purpose codes have been amended to correctly reflect the meeting related
    nature of the expenses.  The payment to the   ....  Transfers received from the
    DNC, DCCC, DSCC and candidate committees, not including ASDC/Dollars for Democrats
    and DNC Victory Fund, were not for joint fundraising.  None of the transfer in
    money received from the DNC or DCCC was used in the payments made for exempt activities.
    \ None of the expenses listed on Line 21b were public communications or FEA activities.
    \ None of the expenditures listed on Line 30b were expressed advocacy.  The payments
    listed on H4, including all consulting fees, were administrative/committee fundraising
    expenses and not FEA nor in connection with a federal election.  Payroll and all
    related expenses reported on Schedule H4 were for staff that did not spend more
    than 25% of their time on FEA or in connection with a federal election.    \n"
